import Converter from "../Converter";
import { BASE16_LOWER_CASE_ENCODE_TABLE } from "../tables/Base16LowerCaseTable";

const EMPTY_ARRAY = new Uint8Array(0);

export default class Base16Encoder extends Converter {
    constructor( table = BASE16_LOWER_CASE_ENCODE_TABLE ) {
        super(null, false);
        this._table = table;
    }

    final() {
        return EMPTY_ARRAY;
    }

    sizeof( bytes, include = true ) {
        return (bytes.length << 1 >>> 0);
    }

    _createOutput( bytes ) {
        return new Uint8Array(this.sizeof(bytes, true));
    }

    _transfrom( bytes, output, offset ) {
        for ( var start = 0; start < bytes.length; ++start ) {
            output[offset++] = this._table[bytes[start] >>> 4 & 0x0F];
            output[offset++] = this._table[bytes[start] & 0x0F];
        }

        return offset;
    }
}

