export default class CRC1 extends CRCBase {
    constructor() { 
        super(0); 
    }

    update( bytes ) {
        for ( var i = 0, len = bytes.length; i < len; ++i ) {
            this._digest = (this._digest + bytes[i]) & 0xFF;
        }
    }
}

