export default function swap32( a ) {
    for ( var k = 0; k < a.length; ++k ) { 
        a[k] = ((a[k] << 8 | a[k] >>> 24) & 0x00FF00FF) | ((a[k] << 24 | a[k] >>> 8) & 0xFF00FF00); 
    }
    return a;
}

